import React from "react";
import { Container, AppBar, Typography, Grow, Grid, Box } from '@mui/material';

import Adventures from './images/Adventures.png';

const App = () => {
    return(
        <Container maxWidth="lg">
            <AppBar position="static" color="inherit">
                <Typography variant="h2" align="center">Adventures</Typography>
                <img src={Adventures} alt="advent" height="100" />
            </AppBar>
        </Container>
    );
}

export default App;
